import { Card, CardContent, Typography } from '@mui/material'
import { Box } from '@mui/system'
import React, { useState } from 'react'
import Icon from 'src/@core/components/icon'

const WilayaComponent = ({}) => {
  const [selectedWilaya, setSelectedWilaya] = useState(null)
  const [selectedDistrict, setSelectedDistrict] = useState(null)
  const [selectedCommune, setSelectedCommune] = useState(null)

  const handleWilayaClick = wilaya => {
    setSelectedWilaya(wilaya)
    setSelectedDistrict(null)
    setSelectedCommune(null)
  }

  const handleDistrictClick = district => {
    setSelectedDistrict(district)
    setSelectedCommune(null)
  }

  const handleCommuneClick = commune => {
    setSelectedCommune(commune)
  }

  const renderWilayas = () => {
    if (!selectedWilaya) {
      return data.wilayas.map(wilaya => (
        <Card key={wilaya.id} onClick={() => handleWilayaClick(wilaya)}>
          <CardContent>
            <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
              <Box sx={{ my: 1.25 }}>
                <Typography variant='h6' sx={{ mb: 5 }}>
                  {wilaya.name}
                </Typography>
                <Typography component='p' variant='caption' sx={{ lineHeight: '1.25rem' }}>
                  {/* Calculated in last 7 days */}
                </Typography>
                <Box sx={{ display: 'flex', alignItems: 'center', '& svg': { color: 'success.main' } }}>
                  <Typography variant='h6'>{}</Typography>
                  <Icon icon='mdi:chevron-up' />
                  <Typography variant='caption' sx={{ color: 'success.main' }}>
                    {/* 15.6% */}
                  </Typography>
                </Box>
              </Box>
            </Box>
          </CardContent>
        </Card>
      ))
    }

    return (
      <div>
        <button onClick={() => setSelectedWilaya(null)}>Back to Wilayas</button>
        <h2>{selectedWilaya.name} Districts</h2>
        {selectedWilaya.districts.map(district => (
          <div key={district.id} onClick={() => handleDistrictClick(district)}>
            {district.name}
          </div>
        ))}
      </div>
    )
  }

  const renderDistricts = () => {
    if (!selectedDistrict) {
      return null
    }

    return (
      <div>
        <button onClick={() => setSelectedDistrict(null)}>Back to Districts</button>
        <h2>{selectedDistrict.name} Communes</h2>
        {selectedDistrict.communes.map(commune => (
          <div key={commune.id} onClick={() => handleCommuneClick(commune)}>
            {commune.name}
          </div>
        ))}
      </div>
    )
  }

  const renderCommunes = () => {
    if (!selectedCommune) {
      return null
    }

    return (
      <div>
        <button onClick={() => setSelectedCommune(null)}>Back to Communes</button>
        <h2>{selectedCommune.name} Entities</h2>
        {selectedCommune.entities.map(entity => (
          <div key={entity.id}>{entity.name}</div>
        ))}
      </div>
    )
  }

  return (
    <div className='flex flex-wrap gap-4'>
      {renderWilayas()}
      {renderDistricts()}
      {renderCommunes()}
    </div>
  )
}

export default WilayaComponent
